import { Routes, Route } from "react-router-dom";
import Accueil from "./components/pages/accueil.jsx";
import TableauDeBord from "./components/pages/tableau_de_bord.js";
import Catways from "./components/pages/catways.jsx";
import Reservations from "./components/pages/reservations.jsx";
import Utilisateurs from "./components/pages/utilisateurs.jsx";
import Header from "./components/header.jsx";
import Footer from "./components/footer.jsx";

import './App.css';
import 'bootstrap-icons/font/bootstrap-icons.css';

function App() {
  return (
    <div className="App">
      <meta name="description" content="API de gestion du Port Russel" />
      <Header />
      <Routes>
      <Route path="/" element={<Accueil />} />
        <Route path="/tableau_de_bord" element={<TableauDeBord />} />
        <Route path="/catways" element={<Catways />} />
        <Route path="/reservations" element={<Reservations />} />
        <Route path="/utilisateurs" element={<Utilisateurs />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
